Нямате контакти за показване.

За добавяне на контакти докоснете Меню и след това:

Профили, за да добавите или настроите профил с контакти, които можете да синхронизирате с телефона;

Нов контакт, за да създадете съвсем нов контакт;

Импортиране/Експортиране, за да импортирате контакти от своята %s или SD карта.

